import React from 'react';
import { Header, Icon, Segment, Grid } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Grid columns="equal" inverted>
                <Grid.Row textAlign='center'>
                    <Grid.Column>
                        <Segment color='blue' inverted>
                            <video autoPlay loop muted
                                style={{
                                    position: "relative",
                                    width: "100%",
                                    top: "0%",
                                    left: "50%",
                                    height :"100",
                                    objectFit: "cover",
                                    transform: "translate(-50%,-10%)",
                                    src: {Vikings},
                                    type:"video/mp4"
                                    //zIndex: "-1"
                                }}
                            >
                            </video>
                        </Segment>
                    </Grid.Column>
                </Grid.Row>
            </Grid>

            {/* <video autoPlay loop muted
                        style={{
                            position: "absolute",
                            width: "100%",
                            top: "0%",
                            left: "50%",
                            objectFit: "cover",
                            transform: "translate(-50%,-10%)"
                            //zIndex: "-1"
                        }}
                    >
                        <source src={Vikings} type="video/mp4" />
                    </video> */}


        </React.Fragment>
    )
}

{/* <React.Fragment>
<Segment placeholder>
    <video
        autoPlay
        loop
        muted
        style={{
             position: "absolute",
             width:"100%",
             top: "0%",
             left:"50%",
             height: "100%",
             objectFit: "cover",
            transform: "translate(-50%,-10%)"
        }}
    >
        <source src={Vikings} type="video/mp4" />
    </video>
</Segment>
<div>dsfsdfsdfsd</div>
</React.Fragment> */}

export default HeaderPart;
